import react from "react";
import './styles/Login.css'


class Login extends react.Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: ''
        }
    }


    render() {
        return (
            <div class="form-container">
                <form class="w-100 hello">
                    <h1 class="h3 mb-3 fw-normal">Sign In</h1>

                    <div class="form-floating">
                        <input type="email" class="form-control mb-3" placeholder="name@example.com" />
                        <label for="floatingInput" class="mb-3">Email address</label>
                    </div>
                    <div class="form-floating">
                        <input type="password" class="form-control mb-3" placeholder="Password" />
                        <label for="floatingPassword">Password</label>
                    </div>
                    <button class="w-100 btn btn-lg btn-primary login-button" type="submit">Sign in</button>
                </form>
            </div>

        );
    };
}


export default Login;
